import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';

import iconSupplements from '../images/iconSupplements.png';
import iconInjury from '../images/iconInjury.png';
import iconIllness from '../images/iconIllness.png';
import iconSkin from '../images/iconSkin.png';
import iconDisinfectant from '../images/iconDisinfectant.png';
import iconMedicalTools from '../images/iconMedicalTools.png';
import boldRedMedicalTools from '../images/boldRedMedicalTools.png';
import facebookicon from '../images/facebookicon.png';


const fatihicon = 'https://www.flaticon.com/free-icons/supplement';
const mavadee = 'https://www.flaticon.com/free-icons/patch';
const eucalyp = 'https://www.flaticon.com/free-icons/cough';
const surang = 'https://www.flaticon.com/free-icons/rash';
const amonrat = 'https://www.flaticon.com/free-icons/germ';
const freepik = 'https://www.flaticon.com/free-icons/surgery';
const triangle = 'https://www.flaticon.com/free-icons/surgical-instrument';
const fbFreepik = 'https://www.flaticon.com/free-icons/facebook';

const karolina = 'https://www.pexels.com/photo/yellow-stethoscope-4047068/';
const nataliyaWhite = 'https://www.pexels.com/photo/flat-lay-photo-of-alternative-medicines-7615460/';
const nataliyaGreen = 'https://www.pexels.com/photo/flat-lay-photo-of-alternative-medicines-7615574/';
const rdne = 'https://www.pexels.com/photo/elderly-couple-holding-bouquet-of-flowers-while-holding-hands-5637572/';
const shotpot = 'https://www.pexels.com/photo/mom-and-dad-having-fun-playing-together-with-their-daughter-7705884/';

function PopupModal() {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>
      <p><a className="link" href={() => false} onClick={handleShow}>Flaticon and Pexels attribution â€¢</a></p>

      <Modal
        show={show}
        onHide={handleClose}
        backdrop="static"
        keyboard={false}
      >
        <Modal.Header closeButton>
          <Modal.Title>Attributions</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <p><b>Pexels Attributions</b></p>
          <p>
            Pink stethoscope photo by 
            <a className="link" title="surgery icons" href={karolina} target="_blank" rel="noreferrer noopener"> Karolina Grabowska</a>
          </p>
          <p>
            Pills with white background by 
            <a className="link" title="surgical icons" href={nataliyaWhite} target="_blank" rel="noreferrer noopener"> Nataliya Vaitkevich</a>
          </p>
          <p>
            Pills with green background by 
            <a className="link" title="surgical icons" href={nataliyaGreen} target="_blank" rel="noreferrer noopener"> Nataliya Vaitkevich</a>
          </p>
          <p>
            Elderly couple photo by 
            <a className="link" title="surgical icons" href={rdne} target="_blank" rel="noreferrer noopener"> RDNE Stock project</a>
          </p>
          <p>
            Family photo by 
            <a className="link" title="surgical icons" href={shotpot} target="_blank" rel="noreferrer noopener"> ShotPot</a>
          </p>


          <p><b>Flaticon Attributions</b></p>
          <p>
            <img className="mini-icon" src={iconSupplements} alt="supplements icon"/> Supplement icons created by 
            <a className="link" title="supplement icons" href={fatihicon} target="_blank" rel="noreferrer noopener"> fatihicon</a>
          </p>
          <p>
              <img className="mini-icon" src={iconInjury} alt="patch icons"/> Patch icons created by 
              <a className="link" title="patch icons" href={mavadee} target="_blank" rel="noreferrer noopener"> mavadee</a>
          </p>
          <p>
              <img className="mini-icon" src={iconIllness} alt="cough icons"/> Cough icons created by 
              <a className="link" title="cough icons" href={eucalyp} target="_blank" rel="noreferrer noopener"> eucalyp</a>
          </p>
          <p>
            <img className="mini-icon" src={iconSkin} alt="rash icons"/> Rash icons created by
            <a className="link" title="rash icons" href={surang} target="_blank" rel="noreferrer noopener"> surang</a>
          </p>
          <p>
            <img className="mini-icon" src={iconDisinfectant} alt="germ icons"/> Germ icons created by
            <a className="link" title="germ icons" href={amonrat} target="_blank" rel="noreferrer noopener"> amonrat rungreangfangsai</a>
          </p>
          <p>
            <img className="mini-icon" src={iconMedicalTools} alt="surgical icons"/> Surgical instrument icons created by
            <a className="link" title="surgical icons" href={triangle} target="_blank" rel="noreferrer noopener"> triangle squad</a>
          </p>
          <p>
            <img className="mini-icon" src={boldRedMedicalTools} alt="surgery icons"/> Surgery icons created by
            <a className="link" title="surgery icons" href={freepik} target="_blank" rel="noreferrer noopener"> freepik</a>
          </p>
          <p>
            <img className="mini-icon" src={facebookicon} alt="surgical icons"/> Facebook icons created by
            <a className="link" title="surgical icons" href={fbFreepik} target="_blank" rel="noreferrer noopener"> freepik</a>
          </p>
          <p>Thank you to all the authors for your wonderful creation!</p>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="primary" onClick={handleClose}>Close</Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

export default PopupModal;
